import React from 'react';
import logo from './logo.svg';
import { Route, Switch, withRouter } from "react-router-dom"
import BookingTickets from './component/BookingTickets'
import jwt_decode from 'jwt-decode'
import './App.css';

function App() {
  return (
    <div className="App">
     <Route exact path="/BookingTickets" component={BookingTickets} />
    </div>
  );
}

export default App;
